import {Outlet} from 'react-router-dom';
import MainNav from '../Components/MainNav';
import classes from './Root.module.css';

function Root(){
    return(
        <>
            <MainNav></MainNav>
        <section className={classes.content}>
            <Outlet></Outlet>
        </section>
        </>
    )
}

export default Root;
